input.script:
// Capturar erros do console e informações de rede
const performanceEntries = performance.getEntriesByType('resource');
const failedRequests = performanceEntries.filter(entry => 
  entry.name.includes('api') && entry.name.includes('b2406547-500c-42ef-be26-5905903b1522')
);

// Capturar erros do console
const consoleErrors = [];
const originalError = console.error;
console.error = function(...args) {
  consoleErrors.push(args.join(' '));
  originalError.apply(console, args);
};

// Verificar status da requisição
fetch('http://localhost:3333/api/claude-sessions/b2406547-500c-42ef-be26-5905903b1522')
  .then(res => {
    window.__apiResponse = {
      status: res.status,
      statusText: res.statusText,
      ok: res.ok
    };
    return res.text();
  })
  .then(text => {
    try {
      window.__apiResponseBody = JSON.parse(text);
    } catch {
      window.__apiResponseBody = text;
    }
  })
  .catch(err => {
    window.__apiError = err.message;
  });

// Retornar informações atuais
({
  url: window.location.href,
  failedRequests: failedRequests.map(r => ({ name: r.name, duration: r.duration })),
  consoleErrors: consoleErrors,
  errorText: document.body.innerText
})

