  return useQuery<RAGDocument[]>({
    queryKey: ['rag-documents', limit],
    queryFn: async () => {
      const response = await fetch(`${API_URL}/api/rag/documents?limit=${limit}`)

      if (!response.ok) {
        throw new Error('Erro ao buscar documentos')
      }

      const data = await response.json()

